import React from 'react';
import { IonButtons, IonButton, IonIcon } from '@ionic/react';
import { cogOutline } from 'ionicons/icons';


const SettingItem = (
    <IonButtons slot="end">
        <IonButton>
            <IonIcon slot="icon-only" icon={cogOutline}></IonIcon>
        </IonButton>
    </IonButtons>
)

export default SettingItem;
